import React,{useState, useEffect} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Grid,Button, Typography,Box, Container} from '@material-ui/core';
import {useNavigate,useParams,Link} from 'react-router-dom';
import KeyboardDoubleArrowDownIcon from '@material-ui/icons/KeyboardArrowDown';
import { KeyboardArrowUp } from '@material-ui/icons';
import { Twitter, Instagram, Facebook} from '@material-ui/icons';
import './headerTitle.css';
import AppBreadcrumbs from '../Breadcrumbs';

const HeaderTitle = ({title}) => {
  return (
    <Grid item xs={12} className="headerTitlecontainer">   
      <h1>Product Detail</h1>
       <AppBreadcrumbs />
      <div  className="menu">
        <a href='/'>Home {`>`}</a>
        <a href='#'>Product Detail</a>
      </div>
    </Grid>
  )
}

export default HeaderTitle;
